import React, { useState } from "react";
import { CarouselContent } from "./CarouselContent";

export const Carousel = () => {
  const [active, setActive] = useState(0);

  const img = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
  ];

  return (
    <div className="w-screen mt-40 flex justify-center">
      <div className="w-[350px] h-[200px] border-2  rounded-md flex">
        <button
          className="w-[30px] text-xl font-bold"
          onClick={() => {
            setActive((prev) => {
              if (prev - 1 < 0) {
                return prev + 2;
              } else {
                return prev - 1;
              }
            });
          }}
        >
          {"<"}
        </button>
        <CarouselContent data={img[active]} />
        <button
          className="w-[30px] text-xl font-bold"
          onClick={() => {
            setActive((prev) => {
              if (prev + 1 > 2) {
                return prev - 2;
              } else {
                return prev + 1;
              }
            });
          }}
        >
          {">"}
        </button>
      </div>
    </div>
  );
};
